import React from 'react';
import './NavbarHome.css';
import { Link } from "react-router-dom";
import {useState} from 'react'
import axios from 'axios'

const Home = () => {

    const [searchTerm, setsearchTerm] = useState("")
    console.log(searchTerm)

    const getSearchProfile = async () => {
        const profile =  await axios.post(`/Profile/${searchTerm}`)
    }

    return (
        <>
            <div className="navbar">
                <div className="navleft">
                    <div className="logo"> <i className="fab fa-speakap fa-2x"></i> </div>
                    <div className="title">Snapbook</div>
                </div>

                <div className="navcenter">
                    <form id="form">
                        <input 
                            className="input_search" 
                            type="search" 
                            onChange={(e)=>setsearchTerm(e.target.value)} 
                            id="search" 
                            value={searchTerm} 
                            placeholder="Search..." 
                        />
                        <button className="btn_search"  onClick = {getSearchProfile}   ><i class="fa fa-search"></i></button>
                    </form>
                </div>
                <div className="dropdown navright">
                    <img className="nav_img" id="profile"
                        src="https://picsum.photos/200">
                    </img>
                    <div className="dropdown-content">
                        <Link className='link itemHover' to="/userProfile" > Profile  </Link>
                        <Link className='link itemHover' to="/viewPosts" > Saved  </Link>
                        <a href="#"> Settings </a>
                        <hr />
                        <a href="#"> Log-outttt</a>
                    </div>
                </div>
            </div>
        </>
    );
};

export default Home;
